1037","type":"GlyphRenderer"},{"id":"1051","type":"GlyphRenderer"}],"title":{"id":"1039","type":"Title"},"toolbar":{"id":"1027","type":"Toolbar"},"x_range":{"id":"1003","type":"DataRange1d"},"x_scale":{"id":"1007","type":"LinearScale"},"y_range":{"id":"1005","type":"DataRange1d"},"y_scale":{"id":"1009","type":"LinearScale"}},"id":"1002","subtype":"Figure","type":"Plot"},{"attributes":{"mantissas":[1,2,5]},"id":"1017","type":"BasicTicker"},{"attributes":{"xs":{"field":"xs"},"ys":{"field":"ys"}},"id":"2420","type":"MultiLine"},{"attributes":{"editor":{"id":"2458","type":"StringEditor"},"field":"values","formatter":{"id":"2457","type":"StringFormatter"},"title":"Value"},"id":"2433","type":"TableColumn"},{"attributes":{"editor":{"id":"2456","type":"StringEditor"},"field":"props","formatter":{"id":"2455","type":"StringFormatter"},"title":"Property"},"id":"2432","type":"TableColumn"},{"attributes":{},"id":"2455","type":"StringFormatter"},{"attributes":{},"id":"2459","type":"UnionRenderers"},{"attributes":{"callback":null,"data":{"doc":["\n    The fill color for the plot border style.\n    ","\n    The (default) data range of the vertical dimension of the plot.\n    ","\n    Whether the component will be visible and a part of a layout.\n    ","\n    The (default) data range of the horizontal dimension of the plot.\n    ","\n    Describes how the component should maintain its height.\n\n    ``\"auto\"``\n        Use component's preferred sizing policy.\n\n    ``\"fixed\"``\n        Use exactly ``height`` pixels. Component will overflow if it can't fit in the\n        available vertical space.\n\n    ``\"fit\"``\n        Use component's preferred height (if set) and allow to fit into the available\n        vertical space within the minimum and maximum height bounds (if set). Component's\n        height neither will be aggressively minimized nor maximized.\n\n    ``\"min\"``\n        Use as little vertical space as possible, not less than the minimum height (if set).\n        The starting point is the preferred height (if set). The height of the component may\n        shrink or grow depending on the parent layout, aspect management and other factors.\n\n    ``\"max\"``\n        Use as much vertical space as possible, not more than the maximum height (if set).\n        The starting point is the preferred height (if set). The height of the component may\n        shrink or grow depending on the parent layout, aspect management and other factors.\n\n    .. note::\n        This is an experimental feature and may change in future. Use it at your\n        own discretion. Prefer using ``sizing_mode`` if this level of control isn't\n        strictly necessary.\n\n    ","\n    Whether the widget will be disabled when rendered.\n\n    If ``True``, the widget will be greyed-out and not responsive to UI events.\n    ","\n    The line dash offset for the plot border outline.\n    ","\n    The alignment point within the parent container.\n\n    This property is useful only if this component is a child element of a layout\n    (e.g. a grid). Self alignment can be overridden by the parent container (e.g.\n    grid track align).\n    ","\n    A title for the plot. Can be a text string or a Title annotation.\n    ","\n    Where the title will be located. Titles on the left or right side\n    will be rotated.\n    ","\n    The width of a plot frame or the inner width of a plot, excluding any\n    axes, titles, border padding, etc.\n    ","\n    The outer height of a plot, including any axes, titles, border padding, etc.\n\n    .. note::\n        This corresponds directly to the height of the HTML canvas.\n\n    ","\n    A list of renderers to occupy the center area (frame) of the plot.\n    ","\n    What kind of scale to use to convert y-coordinates in data space\n    into y-coordinates in screen space.\n    ","\n    A list of all renderers for this plot, including guides and annotations\n    in addition to glyphs and markers.\n\n    This property can be manipulated by hand, but the ``add_glyph`` and\n    ``add_layout`` methods are recommended to help make sure all necessary\n    setup is performed.\n    ","\n    Decimation factor to use when applying level-of-detail decimation.\n    ","\n    An optional list of arbitrary, user-supplied values to attach to this\n    model.\n\n    This data can be useful when querying the document to retrieve specific\n    Bokeh models:\n\n    .. code:: python\n\n        &gt;&gt;&gt; r = plot.circle([1,2,3], [4,5,6])\n        &gt;&gt;&gt; r.tags = [\"foo\", 10]\n        &gt;&gt;&gt; plot.select(tags=['foo', 10])\n        [GlyphRenderer(id='1de4c3df-a83d-480a-899b-fb263d3d5dd9', ...)]\n\n    Or simply a convenient way to attach any necessary metadata to a model\n    that can be accessed by ``CustomJS`` callbacks, etc.\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any tags\n        that are provided, nor are the tags used directly by Bokeh for any\n        reason.\n\n    ","\n    Minimal width of the component (in pixels) if width is adjustable.\n    ","\n    A list of renderers to occupy the area to the right of the plot.\n    ","\n    Specify the aspect ratio behavior of the plot. Aspect ratio is defined as\n    the ratio of width over height. This property controls whether Bokeh should\n    attempt the match the (width/height) of *data space* to the (width/height)\n    in pixels of *screen space*.\n\n    Default is ``False`` which indicates that the *data* aspect ratio and the\n    *screen* aspect ratio vary independently. ``True`` indicates that the plot\n    aspect ratio of the axes will match the aspect ratio of the pixel extent\n    the axes. The end result is that a 1x1 area in data space is a square in\n    pixels, and conversely that a 1x1 pixel is a square in data units.\n\n    .. note::\n        This setting only takes effect when there are two dataranges. This\n        setting only sets the initial plot draw and subsequent resets. It is\n        possible for tools (single axis zoom, unconstrained box zoom) to\n        change the aspect ratio.\n\n    .. warning::\n        This setting is incompatible with linking dataranges across multiple\n        plots. Doing so may result in undefined behaviour.\n    ","\n    A mapping of attribute names to lists of ``CustomJS`` callbacks, to be set up on\n    BokehJS side when the document is created.\n\n    Typically, rather then modifying this property directly, callbacks should be\n    added using the ``Model.js_on_change`` method:\n\n    .. code:: python\n\n        callback = CustomJS(code=\"console.log('stuff')\")\n        plot.x_range.js_on_change('start', callback)\n\n    ","\n    Describes how the component should maintain its width.\n\n    ``\"auto\"``\n        Use component's preferred sizing policy.\n\n    ``\"fixed\"``\n        Use exactly ``width`` pixels. Component will overflow if it can't fit in the\n        available horizontal space.\n\n    ``\"fit\"``\n        Use component's preferred width (if set) and allow it to fit into the available\n        horizontal space within the minimum and maximum width bounds (if set). Component's\n        width neither will be aggressively minimized nor maximized.\n\n    ``\"min\"``\n        Use as little horizontal space as possible, not less than the minimum width (if set).\n        The starting point is the preferred width (if set). The width of the component may\n        shrink or grow depending on the parent layout, aspect management and other factors.\n\n    ``\"max\"``\n        Use as much horizontal space as possible, not more than the maximum width (if set).\n        The starting point is the preferred width (if set). The width of the component may\n        shrink or grow depending on the parent layout, aspect management and other factors.\n\n    .. note::\n        This is an experimental feature and may change in future. Use it at your\n        own discretion. Prefer using ``sizing_mode`` if this level of control isn't\n        strictly necessary.\n\n    ","\n    List of events that are subscribed to by Python callbacks. This is\n    the set of events that will be communicated from BokehJS back to\n    Python for this model.\n    ","\n    Minimal height of the component (in pixels) if height is adjustable.\n    ","\n    Allows to create additional space around the component.\n    ","\n    Interval (in ms) during which an interactive tool event will enable\n    level-of-detail downsampling.\n    ","\n    The fill color for the plot background style.\n    ","\n    A value to be given for increased aspect ratio control. This value is added\n    multiplicatively to the calculated value required for ``match_aspect``.\n    ``aspect_scale`` is defined as the ratio of width over height of the figure.\n\n    For example, a plot with ``aspect_scale`` value of 2 will result in a\n    square in *data units* to be drawn on the screen as a rectangle with a\n    pixel width twice as long as its pixel height.\n\n    .. note::\n        This setting only takes effect if ``match_aspect`` is set to ``True``.\n    ","\n    A list of renderers to occupy the area above of the plot.\n    ","\n    An arbitrary, user-supplied name for this model.\n\n    This name can be useful when querying the document to retrieve specific\n    Bokeh models.\n\n    .. code:: python\n\n        &gt;&gt;&gt; plot.circle([1,2,3], [4,5,6], name=\"temp\")\n        &gt;&gt;&gt; plot.select(name=\"temp\")\n        [GlyphRenderer(id='399d53f5-73e9-44d9-9527-544b761c7705', ...)]\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any names\n        that are provided, nor is the name used directly by Bokeh for any\n        reason.\n\n    ","\n    Specify the output backend for the plot area. Default is HTML5 Canvas.\n\n    .. note::\n        When set to ``webgl``, glyphs without a WebGL rendering implementation\n        will fall back to rendering onto 2D canvas.\n    ","\n    A mapping of event names to lists of ``CustomJS`` callbacks.\n\n    Typically, rather then modifying this property directly, callbacks should be\n    added using the ``Model.js_on_event`` method:\n\n    .. code:: python\n\n        callback = CustomJS(code=\"console.log('tap event occurred')\")\n        plot.js_on_event('tap', callback)\n    ","\n    What kind of scale to use to convert x-coordinates in data space\n    into x-coordinates in screen space.\n    ","\n    The fill alpha for the plot background style.\n    ","\n    A convenience property to set all all the ``min_border_X`` properties\n    to the same value. If an individual border property is explicitly set,\n    it will override ``min_border``.\n    ","\n    The line cap for the plot border outline.\n    ","\n    Describes the proportional relationship between component's width and height.\n\n    This works if any of component's dimensions are flexible in size. If set to\n    a number, ``width / height = aspect_ratio`` relationship will be maintained.\n    Otherwise, if set to ``\"auto\"``, component's preferred width and height will\n    be used to determine the aspect (if not set, no aspect will be preserved).\n\n    ","\n    The line join for the plot border outline.\n    ","\n    Background color of the component.\n    ","\n    The height of the component (in pixels).\n\n    This can be either fixed or preferred height, depending on height sizing policy.\n    ","\n    The line dash for the plot border outline.\n    ","\n    The width of the component (in pixels).\n\n    This can be either fixed or preferred width, depending on width sizing policy.\n    ","\n    The line alpha for the plot border outline.\n    ","\n    Additional named ranges to make available for mapping x-coordinates.\n\n    This is useful for adding additional axes.\n    ","\n    Additional named ranges to make available for mapping y-coordinates.\n\n    This is useful for adding additional axes.\n    ","\n    The toolbar associated with this plot which holds all the tools. It is\n    automatically created with the plot if necessary.\n    ","\n    Minimal height of the component (in pixels) if height is adjustable.\n    ","\n    How the component should size itself.\n\n    This is a high-level setting for maintaining width and height of the component. To\n    gain more fine grained control over sizing, use ``width_policy``, ``height_policy``\n    and ``aspect_ratio`` instead (those take precedence over ``sizing_mode``).\n\n    Possible scenarios:\n\n    ``\"fixed\"``\n        Component is not responsive. It will retain its original width and height\n        regardless of any subsequent browser window resize events.\n\n    ``\"stretch_width\"``\n        Component will responsively resize to stretch to the available width, without\n        maintaining any aspect ratio. The height of the component depends on the type\n        of the component and may be fixed or fit to component's contents.\n\n    ``\"stretch_height\"``\n        Component will responsively resize to stretch to the available height, without\n        maintaining any aspect ratio. The width of the component depends on the type\n        of the component and may be fixed or fit to component's contents.\n\n    ``\"stretch_both\"``\n        Component is completely responsive, independently in width and height, and\n        will occupy all the available horizontal and vertical space, even if this\n        changes the aspect ratio of the component.\n\n    ``\"scale_width\"``\n        Component will responsively resize to stretch to the available width, while\n        maintaining the original or provided aspect ratio.\n\n    ``\"scale_height\"``\n        Component will responsively resize to stretch to the available height, while\n        maintaining the original or provided aspect ratio.\n\n    ``\"scale_both\"``\n        Component will responsively resize to both the available width and height, while\n        maintaining the original or provided aspect ratio.\n\n    ","\n    A list of renderers to occupy the area below of the plot.\n    ","\n    The line width for the plot border outline.\n    ","\n    Minimum size in pixels of the padding region below the bottom of\n    the central plot region.\n\n    .. note::\n        This is a *minimum*. The padding region may expand as needed to\n        accommodate titles or axes, etc.\n\n    ","\n    Minimum size in pixels of the padding region to the left of\n    the central plot region.\n\n    .. note::\n        This is a *minimum*. The padding region may expand as needed to\n        accommodate titles or axes, etc.\n\n    ","\n    A list of renderers to occupy the area to the left of the plot.\n    ","\n    The outer width of a plot, including any axes, titles, border padding, etc.\n\n    .. note::\n        This corresponds directly to the width of the HTML canvas.\n\n    ","\n    Where the toolbar will be located. If set to None, no toolbar\n    will be attached to the plot.\n    ","\n    Minimum size in pixels of the padding region above the top of the\n    central plot region.\n\n    .. note::\n        This is a *minimum*. The padding region may expand as needed to\n        accommodate titles or axes, etc.\n\n    ","\n    The fill alpha for the plot border style.\n    ","\n    A list of CSS class names to add to this DOM element. Note: the class names are\n    simply added as-is, no other guarantees are provided.\n\n    It is also permissible to assign from tuples, however these are adapted -- the\n    property will always contain a list.\n    ","\n    The height of a plot frame or the inner height of a plot, excluding any\n    axes, titles, border padding, etc.\n    ","\n    Minimal width of the component (in pixels) if width is adjustable.\n    ","\n    Minimum size in pixels of the padding region to the right of\n    the central plot region.\n\n    .. note::\n        This is a *minimum*. The padding region may expand as needed to\n        accommodate titles or axes, etc.\n\n    ","\n    How a plot should respond to being reset. By deafult, the standard actions\n    are to clear any tool state history, return plot ranges to their original\n    values, undo all selections, and emit a ``Reset`` event. If customization\n    is desired, this property may be set to ``\"event_only\"``, which will\n    suppress all of the actions except the Reset event.\n    ","\n    Stick the toolbar to the edge of the plot. Default: True. If False,\n    the toolbar will be outside of the axes, titles etc.\n    ","\n    The line color for the plot border outline.\n    ","\n    A number of data points, above which level-of-detail downsampling may\n    be performed by glyph renderers. Set to ``None`` to disable any\n    level-of-detail downsampling.\n    ","\n    Timeout (in ms) for checking whether interactive tool events are still\n    occurring. Once level-of-detail mode is enabled, a check is made every\n    ``lod_timeout`` ms. If no interactive tool events have happened,\n    level-of-detail mode is disabled.\n    ","\n    Whether to use HiDPI mode when available.\n    ","\n    An arbitrary, user-supplied name for this model.\n\n    This name can be useful when querying the document to retrieve specific\n    Bokeh models.\n\n    .. code:: python\n\n        &gt;&gt;&gt; plot.circle([1,2,3], [4,5,6], name=\"temp\")\n        &gt;&gt;&gt; plot.select(name=\"temp\")\n        [GlyphRenderer(id='399d53f5-73e9-44d9-9527-544b761c7705', ...)]\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any names\n        that are provided, nor is the name used directly by Bokeh for any\n        reason.\n\n    ","\n    An optional list of arbitrary, user-supplied values to attach to this\n    model.\n\n    This data can be useful when querying the document to retrieve specific\n    Bokeh models:\n\n    .. code:: python\n\n        &gt;&gt;&gt; r = plot.circle([1,2,3], [4,5,6])\n        &gt;&gt;&gt; r.tags = [\"foo goal to approach as well\n        as can be, in the context of a specific ticking strategy.\n    ","\n    The number of minor tick positions to generate between\n    adjacent major tick values.\n    ","\n    The column data index to use for drawing the representative items.\n\n    If None (the default), then Bokeh will automatically choose an index to\n    use. If the label does not refer to a data column name, this is typically\n    the first data point in the data source. Otherwise, if the label does\n    refer to a column name, the legend will have \"groupby\" behavior, and will\n    choose and display representative points from every \"group\" in the column.\n\n    If set to a number, Bokeh will use that number as the index in all cases.\n    ","\n    A list of the glyph renderers to draw in the legend. If ``label`` is a field,\n    then all data_sources of renderers must be the same.\n    ","\n    An arbitrary, user-supplied name for this model.\n\n    This name can be useful when querying the document to retrieve specific\n    Bokeh models.\n\n    .. code:: python\n\n        &gt;&gt;&gt; plot.circle([1,2,3], [4,5,6], name=\"temp\")\n        &gt;&gt;&gt; plot.select(name=\"temp\")\n        [GlyphRenderer(id='399d53f5-73e9-44d9-9527-544b761c7705', ...)]\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any names\n        that are provided, nor is the name used directly by Bokeh for any\n        reason.\n\n    ","\n    An optional list of arbitrary, user-supplied values to attach to this\n    model.\n\n    This data can be useful when querying the document to retrieve specific\n    Bokeh models:\n\n    .. code:: python\n\n        &gt;&gt;&gt; r = plot.circle([1,2,3], [4,5,6])\n        &gt;&gt;&gt; r.tags = [\"foo\", 10]\n        &gt;&gt;&gt; plot.select(tags=['foo', 10])\n        [GlyphRenderer(id='1de4c3df-a83d-480a-899b-fb263d3d5dd9', ...)]\n\n    Or simply a convenient way to attach any necessary metadata to a model\n    th unds are provided as a tuple of ``(min, max)`` so regardless of whether\n    your range is increasing or decreasing, the first item should be the\n    minimum value of the range and the second item should be the maximum.\n    Setting ``min &gt; max`` will result in a ``ValueError``.\n\n    If you only want to constrain one end of the plot, you can set ``min`` or\n    ``max`` to ``None`` e.g. ``DataRange1d(bounds=(None, 12))``\n    ","\n    The level that the range is allowed to zoom in, expressed as the\n    minimum visible interval. If set to ``None`` (default), the minimum\n    interval is not bound.","\n    How much padding to add around the computed data bounds.\n\n    When ``range_padding_units`` is set to ``\"percent\"``, the span of the\n    range span is expanded to make the range ``range_padding`` percent larger.\n\n    When ``range_padding_units`` is set to ``\"absolute\"``, the start and end\n    of the range span are extended by the amount ``range_padding``.\n    ","\n    If True, renderers that that are not visible will be excluded from automatic\n    bounds computations.\n    ","\n    An explicitly supplied range start. If provided, will override\n    automatically computed start value.\n    ","\n    If ``follow`` is set to ``\"start\"`` or ``\"end\"`` then the range will\n    always be constrained to that::\n\n         abs(r.start - r.end) &lt;= follow_interval\n\n    is maintained.\n\n    ","\n    A list of names to query for. If set, only renderers that\n    have a matching value for their ``name`` attribute will be used\n    for autoranging.\n    ","\n    An optional list of arbitrary, user-supplied values to attach to this\n    model.\n\n    This data can be useful when querying the document to retrieve specific\n    Bokeh models:\n\n    .. code:: python\n\n        &gt;&gt;&gt; r = plot.circle([1,2,3], [4,5,6])\n        &gt;&gt;&gt; r.tags = [\"foo\", 10]\n        &gt;&gt;&gt; plot.select(tags=['foo', 10])\n        [GlyphRenderer(id='1de4c3df-a83d-480a-899b-fb263d3d5dd9', ...)]\n\n    Or simply a convenient way to attach any necessary metadata to a model\n    that can be accessed by ``CustomJS`` callbacks, etc.\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any tags\n        that are provided, nor are the tags used directly by Bokeh for any\n        reason.\n\n    ","\n    An explicit list of renderers to autorange against. If unset,\n    defaults to all renderers on a plot.\n    ","\n    Whether the range should be \"flipped\" from its normal direction when\n    auto-ranging.\n    ","\n    Configure the data to follow one or the other data extreme, with a\n    maximum range size of ``follow_interval``.\n\n    If set to ``\"start\"`` then the range will adjust so that ``start`` always\n    corresponds to the minimum data value (or maximum, if ``flipped`` is\n    ``True``).\n\n    If set to ``\"end\"`` then the range will adjust so that ``end`` always\n    corresponds to the maximum data value (or minimum, if ``flipped`` is\n    ``True``).\n\n    If set to ``None`` (default), then auto-ranging does not follow, and\n    the range will encompass both the minimum and maximum data values.\n\n    ``follow`` cannot be used with bounds, and if set, bounds will be set to\n    ``None``.\n    ","\n    A mapping of attribute names to lists of ``CustomJS`` callbacks, to be set up on\n    BokehJS side when the document is created.\n\n    Typically, rather then modifying this property directly, callbacks should be\n    added using the ``Model.js_on_change`` method:\n\n    .. code:: python\n\n        callback = CustomJS(code=\"console.log('stuff')\")\n        plot.x_range.js_on_change('start', callback)\n\n    ","\n    An explicitly supplied range end. If provided, will override\n    automatically computed end value.\n    ","\n    The level that the range is allowed to zoom out, expressed as the\n    maximum visible interval. Note that ``bounds`` can impose an\n    implicit constraint ould be\n    added using the ``Model.js_on_change`` method:\n\n    .. code:: python\n\n        callback = CustomJS(code=\"console.log('stuff')\")\n        plot.x_range.js_on_change('start', callback)\n\n    ","\n    List of events that are subscribed to by Python callbacks. This is\n    the set of events that will be communicated from BokehJS back to\n    Python for this model.\n    ","\n    The column data index to use for drawing the representative items.\n\n    If None (the default), then Bokeh will automatically choose an index to\n    use. If the label does not refer to a data column name, this is typically\n    the first data point in the data source. Otherwise, if the label does\n    refer to a column name, the legend will have \"groupby\" behavior, and will\n    choose and display representative points from every \"group\" in the column.\n\n    If set to a number, Bokeh will use that number as the index in all cases.\n    ","\n    A list of the glyph renderers to draw in the legend. If ``label`` is a field,\n    then all data_sources of renderers must be the same.\n    ","\n    An arbitrary, user-supplied name for this model.\n\n    This name can be useful when querying the document to retrieve specific\n    Bokeh models.\n\n    .. code:: python\n\n        &gt;&gt;&gt; plot.circle([1,2,3], [4,5,6], name=\"temp\")\n        &gt;&gt;&gt; plot.select(name=\"temp\")\n        [GlyphRenderer(id='399d53f5-73e9-44d9-9527-544b761c7705', ...)]\n\n    .. note::\n        No uniqueness guarantees or other conditions are enforced on any names\n        that are provided, nor is the name used directly by Bokeh for any\n        reason.\n\n    ","\n    An optional list of arbitrary, user-supplied values to attach to this\n    model.\n\n    This data can be useful when querying the document to retrieve specific\n    Bokeh models:\n\n    .. code:: python\n\n        &gt;&gt;&gt; r = plot.circle([1,2,3], [4,5,6])\n        &gt;&gt;&gt; r.tags = [\"foo\", 10]\n        &gt;&gt;&gt; p nt('tap', callback)\n    ","\n    A mapping of attribute names to lists of ``CustomJS`` callbacks, to be set up on\n    BokehJS side when the document is created.\n\n    Typically, rather then modifying this property directly, callbacks should be\n    added using the ``Model.js_on_change`` method:\n\n    .. code:: python\n\n        callback = CustomJS(code=\"console.log('stuff')\")\n        plot.x_range.js_on_change('start', callback)\n\n    ","\n    A particular (named) y-range to use for computing screen locations when\n    rendering glyphs on the plot. If unset, use the default y-range.\n    ","\n    List of events that are subscribed to by Python callbacks. This is\n    the set of events that will be communicated from BokehJS back to\n    Python for this model.\n    ","\n    A view into the data source to use when rendering glyphs. A default view\n    of the entire data source is created when a view is not passed in during\n    initialization.\n    ","\n    The glyph to render, in conjunction with the supplied data source\n    and ranges.\n    ","\n    An optional glyph used for selected points.\n\n    If set to \"auto\" then the standard glyph will be used for selected\n    points.\n    ","\n    ","\n    The \"scatter\" level indices included in a selection. For example, for a\n    selection on a ``Circle`` glyph, this list records the indices of whicn\n    individual circles are selected.\n\n    For \"multi\" glyphs such as ``Patches``, ``MultiLine``, ``MultiPolygons``,\n    etc, this list records the indices of which entire sub-items are selected.\n    For example, which indidual polygons of a ``MultiPolygon`` are selected.\n    ","\n    An arbitrary, user-supplied name for this model.\n\n    This name can be useful when querying the document to retrieve specific\n    Bokeh models.\n\n    .. code:: python\n\n        &gt;&gt;&gt; plot.circle([1,2,3], [4,5,6], name=\"temp\")\n        &gt;&gt;&gt; plot.select(name=\"temp\")\n        [GlyphRenderer(id='399d53f5-7 tool.formatters = dict(date=\"datetime\")\n\n    will cause format specifications for the \"date\" column to be interpreted\n    according to the \"datetime\" formatting scheme. The following schemes are\n    available:\n\n    :``\"numeral\"``:\n        Provides a wide variety of formats for numbers, currency, bytes, times,\n        and percentages. The full set of formats can be found in the\n        |NumeralTickFormatter| reference documentation.\n\n    :``\"datetime\"``:\n        Provides formats for date and time values. The full set of formats is\n        listed in the |DatetimeTickFormatter| reference documentation.\n\n    :``\"printf\"``:\n        Provides formats similar to C-style \"printf\" type specifiers. See the\n        |PrintfTickFormatter| reference documentation for complete details.\n\n    If no formatter is specified for a column name, the default ``\"numeral\"``\n    formatter is assumed.\n\n    .. |NumeralTickFormatter| replace:: :class:`~bokeh.models.formatters.NumeralTickFormatter`\n    .. |DatetimeTickFormatter| replace:: :class:`~bokeh.models.formatters.DatetimeTickFormatter`\n    .. |PrintfTickFormatter| replace:: :class:`~bokeh.models.formatters.PrintfTickFormatter`\n\n    ","\n    The (name, field) pairs describing what the hover tool should\n    display when there is a hit.\n\n    Field names starting with \"@\" are interpreted as columns on the\n    data source. For instance, \"@temp\" would look up values to display\n    from the \"temp\" column of the data source.\n\n    Field names starting with \"$\" are special, known fields:\n\n    :$index: index of hovered point in the data source\n    :$name: value of the ``name`` property of the hovered glyph renderer\n    :$x: x-coordinate under the cursor in data space\n    :$y: y-coordinate under the cursor in data space\n    :$sx: x-coordinate under the cursor in screen (canvas) space\n    :$sy: y-coordinate under the cursor in screen (canvas) space\n    :$color: color data from data source, with the syntax:\n        ``$color[options]:field_name``. The available options\n        are: 'hex' (to display the color as a hex value), and\n        'swatch' to also display a small color swatch.\n\n    Field names that begin with ``@`` are associated with columns in a\n    ``ColumnDataSource``. For instance the field name ``\"@price\"`` will\n    display values from the ``\"price\"`` column whenever a hover is triggered.\n    If the hover is for the 17th glyph, then the hover tooltip will\n    correspondingly display the 17th price value.\n\n    Note that if a column name contains spaces, the it must be supplied by\n    surrounding it in curly braces, e.g. ``@{adjusted close}`` will display\n    values from a column named ``\"adjusted close\"``.\n\n    Sometimes (especially with stacked charts) it is desirable to allow the\n    name of the column be specified indirectly. The field name ``@$name`` is\n    distinguished in that it will look up the ``name`` field on the hovered\n    glyph renderer, and use that value as the column name. For instance, if\n    a user hovers with the name ``\"US East\"``, then ``@$name`` is equivalent to\n    ``@{US East}``.\n\n    By default, values for fields (e.g. ``@foo``) are displayed in a basic\n    numeric format. However it is possible to control the formatting of values\n    more precisely. Fields can be modified by appending a format specified to\n    the end in curly braces. Some examples are below.\n\n    .. code-block:: python\n\n        \"@foo{0,0.000}\"    # formats 10000.1234 as: 10,000.123\n\n        \"@foo{(.00)}\"      # formats -10000.1234 as: (10000.123)\n\n        \"@foo{($ 0.00 a)}\" # formats 1230974 as: $ 1.23 m\n\n    Specifying a format ``{safe}`` after a field name will override automatic\n    escaping of the tooltip data source. Any HTML tags in the data tags will\n    be rendered as HTML in the resulting HoverTool output. See\n    :ref:`custom_hover_tooltip` for a more detailed example.\n\n    ``None``
